function Page2(props) {
  return (
    <div>
      <h1>page 2</h1>
      <Page1_6Nav text1="계정만들기" text2="로그인" link1="/5" />
      <Btn text="가입하기" link="/3" />
    </div>
  );
}

export default Page2;
